export const extractSymbolFromCoinType = (coinType: string) =>
  coinType.split("::").at(-1);

export const isSuilendPoints = (coinType: string) =>
  normalizeStructTag(coinType) === NORMALIZED_SUILEND_POINTS_COINTYPE;
export const isSui = (coinType: string) =>
  normalizeStructTag(coinType) === NORMALIZED_SUI_COINTYPE;

export const isStablecoin = (coinType: string) =>
  NORMALIZED_STABLECOIN_COINTYPES.includes(normalizeStructTag(coinType));

export const isEthNative = (coinType: string) =>
  [
    NORMALIZED_wUSDC_COINTYPE,
    NORMALIZED_USDT_COINTYPE,
    NORMALIZED_ETH_COINTYPE,
  ].includes(coinType);
export const isSolNative = (coinType: string) =>
  [NORMALIZED_SOL_COINTYPE].includes(coinType);

export const isCoinType = (text: string) => {
  if (text.includes("-")) return false;
  try {
    normalizeStructTag(text);
    return true;
  } catch (err) {}
  return false;
};
